import  NutrientTableEntry from './NutrientTableEntry'
   export default async function NutrientTable(props) {

     return (
         <div>
             <div>
                 <h2> Näringsinnehåll: {props.recipeTitle}</h2>
             </div>
             <div>
                 <div>
                     <div>Näringsämne</div>
                     <div>Mängd</div>
                         <NutrientTableEntry name={'Namn '} value={12} />
                 </div>
                 { 
                     await Object.keys(props.nutrients).forEach(async key => {
                         <NutrientTableEntry name={key} value={props.nutrients[key]} />
                     })

                 }
             </div>
         </div>
     )
   }
